糸ようじ 60本入り<br>ブランド：糸ようじ<br>販売・製造元：小林製薬<br><br>虫歯・歯周病の原因となる歯間の食べカス・歯垢をしっかり除去するデンタルピック(歯間ようじ)です。<br>帯状に並べた6本の細い糸(特殊糸)が、歯間の汚れをからめて取り除きます。<br>ユニークな形状のピックによって、歯の裏など取りにくい食べカスを容易に取り除きます。<br> <br><br><br>使用方法<br>(1)フロスをゆっくりと前後させながら挿入します。<br>(2)歯の側面に沿わせながら上下し歯垢を取ります。<br>(3)同時に歯ぐきを優しくマッサージしてください。<br>※衛生上および機能上、本品1本につき1回のご使用をおすすめします。<br>●歯の裏側の取りにくい歯垢・食べカスはピックでお取りください。<br> <br><br>使用上の注意<br>●歯茎を傷つける恐れがあるため、フロスは歯間に無理に入れない。<br> ●糸が歯に引っ掛かったり切れやすい時は、歯の詰め物が取れていたり虫歯の恐れもあるので、歯科医師に相談する。<br>●お子さまの手の届かない場所に保管する。<br>●本品は歯間清掃具なので、歯と歯の間の清掃以外の目的では使用しない。<br>●使用中、痛みや異常を感じた場合には使用を中止し、歯科医師に相談する。<br> 品質表示柄の材質：ポリスチレン、糸の材質：ナイロン、耐熱温度：80度<br> 原産国台湾 <br><br>お問い合わせ先<br>小林製薬株式会社お客様相談室：06-6203-3625受付時間9：00-17：00(土・日・祝日を除く) <br>日用品／オーラルケア／歯石・歯垢対策／デンタルピック(歯間ようじ)<br>JANコード： 4987072025895<br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
